import React from 'react';

const resposta = {id: 35, item: 'jumper', color: 'red', size: 'medium', price: 20}

class EasyMap extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      lista: {},
    };
    this.mapGenerate = this.mapGenerate.bind(this);
  }

  componentDidMount() {
    this.setState({
      lista: resposta,
    });
  }

  mapGenerate() {
    return this.state.lista.map(index => <p key={index}>{index}</p>
    );
  }

  render() {
    return (
      <div>
        {this.mapGenerate}
      </div>
    );
  }
}

export default EasyMap;
